import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import classScreen from './_screens/classScreen';
import homeScreen from './_screens/homeScreen';


class App extends React.Component {
  render(){
    return (
      <Router>
        <div>
        <ul className="uul"><li className="lii">
            <Link className="linn" to="/">Home</Link>
            </li>
            <li className="lii">
            <Link className="linn" to="/contact">taavar</Link>
            </li>
            <li className="lii">
            <Link className="linn" to="/contact1">onisogo</Link>
            </li>
            <li className="lii">
            <Link className="linn" to="/contact2">asuult</Link>
            </li>
            <li className="lii">
            <Link className="linn" to="/Appp">reaquiest</Link>
            </li>
        </ul>
          <Switch>
            <Route path="/" exact component={classScreen} />
            <Route path="/Home" component={homeScreen} />
          </Switch>
        </div>
      </Router>
    );
  }
}
export default App;
